import React from 'react';
import styled from "styled-components";
import user from '../asstets/img/user.svg'
import settings from "../asstets/img/settings.svg";


const SettingsWrapper = styled.div`
      display: flex;
      justify-content: center;
      align-items: center;
      flex-direction: column;
      margin: 0 auto;
      width: 60vw;
      background-color: orange;
`;

const UserCard = styled.div`
      display: flex;
      justify-content: center;
      align-items: center;
`

const UserAvatarWrapper = styled.div`
margin: 0 auto;
`
const UserMailWrapper = styled.div`
      display: flex;
      justify-content: center;
      align-items: center;
      flex-direction: column;
`
const Button = styled.button`
  display: flex;
  //margin: 50px;
  height: 70px;
  width: 230px;
  text-decoration: none;
  justify-content: center;
  align-items: center;

  color: ${({theme}) => theme.colors.white};
`

const SettingsCard = () => (

    <SettingsWrapper>
        <UserCard>
            <UserAvatarWrapper><img src={user}
                                    alt="Settings icon"/></UserAvatarWrapper>
            <UserMailWrapper>Jeste≈õ zalogowany jako Mati Mati @</UserMailWrapper>
            <Button> Wyloguj</Button>
        </UserCard>
    </SettingsWrapper>
)

export default SettingsCard;
